70	\N	41		\r\nProcedures followed    \r\n      \r\nThe endocrine system is all about communication. There are two main communication pathways in your body: the nervous system and the endocrine system. In the nervous system, signals travel very fast, and lead to almost instantaneous responses. In the endocrine system, chemicals travel through your body more slowly, and the response to these chemicals can be slow and/or long lasting.\r\n \r\nFigure 1. The endocrine system.\r\nHormones\r\nWhat is a hormone? It is a chemical that has a high level of specificity, which means that it will only react with a specific receptor site in your body. The lock and key analogy is often used to explain this specificity, and it is a great way to think about how hormones work. Hormones convey important information to the body, including such instructions as cell division and growth, appetite suppression, acid secretion, calcium absorption, and red and white blood cell production.\r\nHormones are secreted by endocrine glands. There are eight major endocrine glands. Those glands, along with their main functions, are listed below:\r\nPituitary gland – regulates other endocrine glands; secretes growth hormone.\r\nThyroid – regulates metabolic rate.\r\nThymus – assists in development of immune system.\r\nAdrenal gland – regulates fluid and sodium balance; emergency warning system under stress.\r\nOvary – controls development of secondary sex characteristics and functioning of sex organs.\r\nTestis - controls development of secondary sex characteristics and functioning of sex organs.\r\nPancreatic islets – helps regulate blood sugar.\r\nPineal gland - believed to regulate biorhythms and moods and stimulate the onset of puberty.\r\n \r\nFigure 1. \r\nMajor endocrine glands.\r\nTwo hormones that engineers are involved in producing are growth hormone and insulin. Growth hormone can be used for children (or some adults) whose bodies do not produce enough on their own, and insulin is needed for people who have diabetes.\r\n\r\nVocabulary/Definitions\r\nEndocrine Gland:\tA gland in the body which secretes hormones into the bloodstream.\r\nReceptor:\tA specific site on a cell designed to recognize and accept a specific hormone.\r\nHormone:\tA chemical secreted by endocrine glands which carries instructions to the body.\r\nPituitary Gland:\tRegulates other endocrine glands; secretes growth hormone.\r\nThyroid:\tRegulates metabolic rate.\r\nThymus:\tAssists in development of the immune system.\r\nAdrenal Gland:\tRegulates fluid and sodium balance; emergency warning system under stress.\r\nOvary:\tControls development of secondary sex characteristics and functioning of sex organs.\r\nTestis:\tControls development of secondary sex characteristics and functioning of sex organs.\r\nPancreatic islets:\tHelps regulate blood sugar.\r\nPineal gland:\tBelieved to regulate biorhythms and moods and stimulate the onset of puberty.\r\nAssociated Activities\r\n•\tEndocrine Excitement! - Students create hormone-receptor pairs by matching puzzle pieces and then follow the instructions written on the pieces.\r\nLesson Closure\r\nToday we learned about the endocrine system and how it helps the body communicate signals like when to grow or digest food. Who can tell me the four main parts of the endocrine system? (Answer: endocrine glands, hormones, receptor sites, bloodstream) How is the endocrine system like the mail system? Well, the endocrine gland sends a hormone message, like a letter, and the bloodstream mail carrier carries it to the receptor site, like a new mailbox. Lastly, the body reacts to the hormone message, as somebody might if they read the letter. It's all about communication!\r\nWho remembers why communication is important to astronauts and engineers? That's right, astronauts and engineers have to communicate well with each other both on Earth and in outer space. Engineers also design the technologies that make communication in space and on Earth possible, including cell \r\nHome work\r\n•\tAnswer the question given in the reading checks and lesson review.\r\n\r\n\r\n\r\n	2016-02-14 10:02:08.787159	2016-02-14 10:02:08.787159
71	\N	42		 Ever feel overwhelmed when you look at all those muscles in your textbooks? Well if you do, then maybe learning a little about their anatomy and organization and how they work together will help you sort through it all. In this lesson, learn about the muscle itself and how it works with others to help the muscular system function.\r\nFunction of the Muscular System\r\nthe muscular system; it probably seems overwhelming at first, what with all those funky scientific names. There are over 600 skeletal muscles, and that number doesn't even include the smooth muscles! But, like everything else in your body, the muscular system has its own sense of organization. Once you learn a little bit about how it works, it may begin to make a little more sense to you.\r\nEven the naming system is organized. Some muscles are named for their location, while others are named for their shape or the direction in which their fibers run. We won't get into all those names in this lesson, but we will get started with some of the basics. As you have probably guessed, the main function of the muscular system is movement, but it also helps stabilize our joints, maintain our posture and generate heat during activity.\r\nMovement of our body can be voluntary and controlled by the skeletal muscles, or it can be involuntary and controlled by smooth muscles. Those are found mostly in your internal organs and aid in things like digestion and even eyesight. Skeletal muscles, on the other hand, are what make up what we see a human body do. They move all the different parts of the skeleton. The help us in all kinds of movements, such as walking, swimming, writing and even talking. All this movement is aided by the anatomy and organization of the muscular system. But, before we move on we should mention you do have one other type of muscle in your body. Cardiac muscles are found in the heart and are responsible for the movement of blood through your body.\r\nMuscle Anatomy\r\nFirst lets take a brief look at the muscles themselves. Like so many other things, muscles are made up of lots of smaller parts. We'll start at the level of the muscle fiber. A muscle fiber is simply a muscle cell, or the building blocks of muscles. See, just like the rest of your body is made up of lots and lots of individual cells, your muscles are also made up of cells.\r\nMultiple fibers join together to make up our next level of organization, the fascicle. A fascicle is a group, or bundle, of muscle fibers. And, just like many muscle fibers join together to form a fascicle, many fascicles join together to make up a muscle.\r\n \r\nMuscles are composed of fibers and fascicles.\r\nMuscles are made up of groups of fascicles. When stimulated they contract to produce motion. Without muscles, your body wouldn't be able to function. No more running, talking, walking and, well, you get the picture!\r\nThe organization of the muscle allows all the fibers, and thus the fascicles, to contract and relax as a group. Contraction is stimulated by nerve impulses and triggers the movement of the muscle, while relaxation occurs when the impulse is removed and the muscle relaxes back to its natural state. This pattern of contraction and relaxation is responsible for all the movements in your body.\r\nThe part of your body that moves in response to a muscle contraction depends on the location and origin point of the muscles themselves. To simplify things we are going to focus on the skeletal muscles of the body. Most skeletal muscles are attached to bone, cartilage or connective tissue, which limits or directs their movement. For example, a muscle attached to the arm bone will only move the arm bone when stimulated. It cannot move the leg bone; therefore, its movement is determined by its points of attachment.\r\nOrigin and Insertion Points\r\nEach muscle has two main points of attachment, the origin point and the insertion point. The origin of a muscle is the fixed end, the end that doesn't move. This end is usually a bone, cartilage or connective tissue. The opposite end of the muscle is the insertion point. This is the movable end of the muscle which is attached to the structure that is being moved.\r\nLet's go back to our arm muscle example. If we take a look at the upper arm bone, called the humerus, we can see a large muscle on top of it. This muscle, called the biceps brachii has a point of origin up here at the scapula, and its insertion point down here on the radius of the lower arm. When the muscle contracts, it moves the radius upwards towards the scapula, but the scapula and upper arm do not move. That is why the radius is termed the insertion point, while the scapula is the origin point.\r\nIf you're still a little confused about how to tell the difference, you can give it a try on your own. When you move your arm or your leg, take notice of which end of the muscle is doing the moving and which end is staying still. That will help you figure out which is the insertion (that's the one doing the moving) and which is the origin.\r\n \r\nThe origin and insertion points of the biceps brachii\r\nAgonists and Antagonists\r\nWhen a muscle moves, it's because it is stimulated to contract by the nervous system, but what happens after that? How does it return to its starting position? To do that it needs the help of another muscle, which pulls it back.\r\nIn order for one muscle to contract, an opposing muscle must stretch out, or relax. You can think of it like a game of tug of war. When one team pulls the rope towards them the other team's side stretches, and vice versa. It's like a give-and-take relationship, and most of our skeletal muscles work in these pairs. Like the yin and yangs of the muscle system, they balance each other out.\r\nOfficially, these pairs consist of an agonist and antagonist. An agonist is the prime mover, the muscle whose contraction results in a particular movement, while the antagonist performs the opposite action of the agonist.\r\n	2016-02-15 08:27:11.075489	2016-02-15 08:27:11.075489
