73	\N	43		The Integumentary system: Vocabulary terms\r\nAdipose - Of a fatty nature, fat\r\nBiopsy - Removal and examination of living tissue\r\nCeruminous - Pertaining to earwax\r\nDermatitis - Inflammation of the skin\r\nDermis - Corium, or layer of skin beneath the epidermis\r\nEpidermis - Outermost and nonvascular layer of skin\r\nFollicle - Sac or pouchlike depression or cavity\r\nLunula - General term for a small crescent or moon-shaped area of fingernail\r\nMelanin - Dark, shapeless pigment of skin\r\nPapilla - Small, nipple-shaped projection or elevation\r\nPilus - Hair\r\nSebaceous - Pertaining to sebum or a grease lubricating substance\r\nSubcutaneous - Beneath the skin\r\nSudoriferous - Conveying sweat\r\n \r\n\r\nThe Integumentary System\r\nThe Integumentary System is composed of the skin and accessory structures. Accessory structures include the hair, nails, specialized glands, and nerves. The main function of the integumentary system is to protect the other body systems from injury and infection. A second function is to help the body maintain homeostasis by regulatingtemperature, retaining body fluid, and eliminating wastes. The skin stores energy and vitamins and produces vitamin D.\r\n\r\nSkin\r\nThe skin covering 17 to 20 square feet is the largest organ in the body. The skin varies in thickness from 1/50 of an inch in the eyelids to 1/4 of an inch in the soles of the feet.\r\n\r\nThe skin is composed of three layers:\r\n\r\n•\tThe epidermis, or cuticle, is the outermost layer of the skin\r\n•\tThe dermis, or corium, is called the ''true'' skin\r\n•\tThe subcutaneous is the innermost layer of the skin\r\n\r\nThe epidermis is composed of a surface of dead cells with an underlying layer of living cells. Water repellent cells made of protein (keratinocytes) make up 90% of the epidermis. Oil (sebaceous) and sweat (sudoriferous) glands and hair follicles lie in the epidermis. Melanocytes, which produce melanin, are located in this layer. Melanin is the pigment that gives skin its color. The dermis contains the blood vessels and nerves. Each square inch of skin contains fifteen feet of blood vessels. Fatty (adipose) tissue of the subcutaneous layer cusions and insulates the body's organs.\r\n\r\nHair and Hair Follicles\r\nSkin normally has hair (pilus) in all aeas except the soles of the feet and palms of the hands. Some hair blocks foreign particles from entering the body through structures suck as the nose and eyes. Each hair root originates in the dermis. The visual portion is called the shaft.\r\n\r\nThe hair follicle is the root with its covering. One or two oil glands are attached to each hair follicle. A tiny muscle is attached to the hair shaft and causes ''goose bumps'' or the hair to ''stand on end'' in response to cold or fear. Hair color or texture are inherited. The color depends on the amount of melanin in the cells.\r\n\r\nGlands\r\nThe three types of glands in the skin are the\r\n\r\n•\tsebaceous glands (oil)\r\n•\tsudoriferous glands(sweat)\r\n•\tceruminous glands of the ear canal\r\n\r\nSebaceous glands are located everywhere in the skin except the palms of the hands and the soles of the feet. Each square inch of skin has about 2000 sebaceous glands. Sebum, or oil, causes the skin to be soft and waterproof.\r\n\r\nSudoiferous glands originate in the subcutaneous layer of the skin. Some of these glands (apocrine) are attached to hair follicles and others (eccrine) empty directly onto the skin. Apocrine glands are located in areas such as under the arms (axilla), the breasts, and pubic areas. In some areas of the skin, each square inch contains about two million sudoiferous glands.\r\n\r\nCeruminous glands are located only in the auditory canal of the ear. These glands secrete wax that helps to protect the ear from infection and prevents entry of foreign bodies.\r\n	2016-02-15 08:33:30.534311	2016-02-15 08:33:30.534311
