77	\N	44	Wednesday	Lesson 11.6 Systems of Equations\r\n\r\nA system of equations is a set of two or more equations that contain two or more variables.\r\n\r\nA solution of a system of equations is a set of values that are solutions of all of the equations. If the system has two variables, the solutions can be written as ordered pairs.\r\n\r\nExample:\r\nY = x + 3\r\nY = 2x + 5\r\n\r\nThe expressions x + 3 and 2x + 5 both equal to y. So by the Transitive property they are equal to each other.\r\n\r\nSo,\r\n\r\nX + 3 = 2x + 5\r\nX = -2\r\n\r\nTo find y, we substitute x = -2 for x in one of the original equations.\r\n\r\n Y = x + 3\r\nY = -2 + 3\r\nY = 1\r\n\r\nAnswer ( -2,1 )  	2016-02-15 10:10:52.183325	2016-02-15 10:10:52.183325
