108	\N	74	Sunday/Tuesday	•\tExplain to the students that the prefix ad- means “to” or “toward” and that sometimes this prefix is assimilated, or absorbed, into the spelling of the base word. So, ad- + sure becomes assure.\r\n•\tPresent several words using real objects, pictures, and/or gestures. Do choral and individual concept checking. For example, put together a toy or a few interlocking cubes and ask, What do I do? (You assemble)\r\n•\tPractice pronouncing the words with the students. Say each word aloud as you point to it. Break each word into phonemes or syllables. Have students repeat, both chorally and individually.\r\n•\tUse the words in simple sentences and have the students repeat these sentences.\r\n•\tFor multiple-meaning words teach only the most common meaning. \r\n•\tRead each word and its sample sentence.\r\n•\tWrite ten spelling words on the board, misspelling several of them. Ask students to identify the misspelled words.\r\n•\tStudents will practice using the spelling words in different exercises such as replacing the underlined word or words, changing affixes to form spelling words, and writing antonyms.\r\n\r\nHOMEWORK: •\tWrite a paragraph where you imagine that you have invented a new appliance or piece of sports equipment using at least 5-6 spelling words from Unit 20.	2016-02-17 05:47:03.205789	2016-02-17 05:47:03.205789
109	\N	75	Sunday, Tuesday, Thursday	Students will:\r\n•\t understand extended metaphors and other figures of speech. \r\n•\t apply the strategy of questioning before and during reading.\r\n\r\nExplain to the students that:\r\n•\tFigures of Speech compare things that at first glance seem very different. These unusual comparisons let you see familiar things in a new light. The comparisons in figures of speech are imaginative and are not meant to be understood as literally true. \r\nThe most common figures of speech are similes and metaphors. A simile compares to unlike things using the words like or as. Example: The sleeping Calico cat is like a cushion.\r\nA metaphor directly compares two unlike things without the use of a specific word of comparison. Example: The sleeping Calico cat is a cushion.\r\n\r\n•\tAn extended metaphor is a metaphor that is developed, or extended, through several lines of writing or even throughout an entire poem. In “I Like To See It Lap 	2016-02-17 05:54:19.048706	2016-02-17 05:54:19.048706
