110	\N	76	Sunday/Wednesday	•\tTell students that an appositive is a word or phrase that follows a noun and identifies or explains the noun. A comma is used to set off an appositive. If the appositive appears in the middle of a sentence, two commas are used. \r\n•\tModel identifying the appositives in these example sentences: Hatshepsut was a pharaoh, an Egyptian ruler with supreme power. Hatshepsut, the daughter of Pharaoh Thutmose II, lived in Egypt.\r\n•\tWrite the following sentence on the board: The Nile River, the longest river in the world, is over 4,000 miles long. Have students identify the appositive and tell where to place the commas.\r\n•\tExplain that commas are used to punctuate nonrestrictive elements, or nonessential information, such as an appositive. When a sentence contains parenthetical elements, parentheses are placed around the information.\r\n•\tModel identifying the nonrestrictive and parenthetical elements in the example sentences: Hatshepsut, a respected pharaoh, ruled Egypt for many years. She had many monuments (temples and obelisks) built during her reign. \r\n•\tDisplay this sentence: The hieroglyphs, symbols or pictures of objects, told a story. Have students identify the nonrestrictive or parenthetical elements and how to punctuate it.\r\n•\tExplain that dashes can also be used to punctuate a parenthetical element which gives more information about the topic of a sentence. Depending upon where the parenthetical element appears in the sentence, one or two dashes are used to set off the information.\r\n•\tModel identifying a   parenthetical expression set off with dashes in the example: The pharaoh’s statue- the largest of its kind- is made of gold.\r\n•\tDisplay the following sentence and read it aloud: The burial temples-as well as the pyramids- took many years to build. Have students tell how to punctuate the parenthetical element.\r\n•\tReview with students that commas, parentheses, and dashes are used to set off nonrestrictive and parenthetical elements. The element appears at the end of a sentence, only one dash or comma is needed. If the element appears in the middle of a sentence, two dashes or commas are needed. Parentheses are always used in pairs. \r\n•\tExplain that good writers vary their sentences to keep their writing interesting and use proper punctuation so writing is easy to read. Tell students that one way to vary their sentences is to add nonrestrictive and parenthetical phrases and clauses. Remind students to choose the correct punctuation (commas, parentheses, or dashes) for the element they are using.	2016-02-17 06:00:20.754554	2016-02-17 06:00:20.754554
