112	\N	78	Sunday/Tuesday/Thursday	•\tRead the story and discuss all the important elements of realistic fiction.\r\n•\tDiscuss that realistic fiction has characters and events that are like people and events in real life.  \r\n•\tTell the students that they will be reading a realistic fiction text about a boy and the game of baseball. \r\n•\tTell students to look for the following as they read the story: \r\n1.\tCharacters who behave just as people do in real life\r\n2.\tA main character who overcomes a challenge\r\n3.\tReal-life challenges\r\n•\tTell students that a story’s theme is the central idea of a story or it is the author’s message about life. Point out that there may be more than one theme in a story. Explain that usually authors do not directly state the theme in realistic fiction. However, they lead the reader to understand the theme through the story’s events and the character’s reactions, feelings, thoughts, and dialogues. By analyzing and evaluating the plot, or individual scenes in a story, the reader can infer the story’s theme.\r\n•\tTell the students that characters in realistic fiction stories act, think, and feel the same as real people would. Authors give readers clues about what characters are thinking and feeling by showing what they say and do. Students should know that good readers pay attention to how a character responds to or changes as a result of events in the story in order to understand the character’s personality.\r\n•\tExplain to the students that describing a character, setting, or event using figures of speech makes writing more interesting. Authors may use a metaphor, which compares two different things. Metaphors, such as life is a journey, help readers visualize story elements so they can better understand them. \r\n•\tRead the story and ask questions about the story structure.\r\n•\tAsk comprehension questions to analyze the text.\r\n•\tAsk students to infer and predict about what will happen in the story.\r\n•\tDiscuss the reading and literary skills questions.\r\n•\tFill up the Graphic Organizer on Student Book p. 179.	2016-02-17 06:08:25.027355	2016-02-17 06:08:25.027355
