263	\N	145		Math: - Subtraction\r\n\t\r\n-To introduce, identify, and recognize (subtraction).                                                            \r\n        \r\n- Acknowledge new vocabularies (subtract, minus, is equal to).\t\r\n- Use flash cards, real and class room objects.                                                       \r\n- Tell children that minus is a symbol that shows subtraction, and subtraction means taking apart or comparing sets.                                                    \r\n- Tell them that subtraction also means how many are left? \r\n-Give them an example: there are 5 birds on the tree, 3 birds fly away ,how many birds are left on the tree, so we can write the subtraction sentence 5-3=2 etc.…….                                                                                                                      - Ask children to work individually and in groups. \t*Flashcards\r\n\r\n*Art & Craft  (activity)\r\n*Books\t* 3 classes a week.\t\r\n*Children should be able to identify and recognize       (subtraction).                     – Ask them to memorize the vocabularies: (subtract, minus, is equal to) by using worksheet.             – Make sure that they understand the lesson by asking questions related to the subtraction operation.\r\n	2016-02-22 19:00:39.893055	2016-02-22 19:00:39.893055
