405	\N	213	Sunday	Ls 12.1 Graphing Linear Equations\r\nA linear equation is an equation whose solutions fall on a line on the coordinate plane. All solutions of a particular linear equation fall on the line, and all the points on the line are solutions of the equation.\r\n\r\n \r\n\r\nA rate of change is a ratio that compares the amount of change in a dependent variable to the amount of change in an independent variable.\r\n\r\nRate of change =   Change in dependent variable\r\n                                     Change in independent variable\r\n\r\nHW/CW Pg 635	2016-03-10 11:18:20.293792	2016-03-10 11:18:20.293792
