407	\N	213	Tuesday	Ls 12.2 Slope of a line \r\nThe constant rate of change of a line is called the slope of the line.\r\n\r\n•\tThe rise is the difference of the y values of two points on a line.\r\n•\tThe run is the difference in the x values of two points on a line.\r\n•\tThe slope of a line is the ratio of ruse to run for any two points on the line.\r\n \r\nCW/HW Pg 640	2016-03-10 11:18:20.298324	2016-03-10 11:18:20.298324
408	\N	213	Wednesday	Ls 12.3 Using Slopes and Intercepts\r\nThe x-intercept of a line is the value of x where the line crosses the x-axis where y=0 .\r\n\r\nThe y-intercept of a line is the value of y where the line crosses the     y-axis where x = 0.\r\n\r\nSlope intercept form ⇒ y=mx + c\r\n\r\nWhere m= slope\r\n              C = y intercept\r\n\r\nCW/HW Pg 645	2016-03-10 11:18:20.30045	2016-03-10 11:18:20.30045
