422	\N	217		موقع المدينة يثرب\r\nتقع المدينة في غرب المملكة العربية السعودية وبفد إليها المسلمون في كل مكان لزيارة المسجد النبوي الشريف\r\n\r\nطبيعة المدينة يثرب\r\nالمدينة يثرب أرض خصبة التربة وفيرة الماء تكثر فيها الأودية والآبار التي تنتشر حولها المزارع كما تحيط بها الجبال في الشمال والجنوب  والحرات التي تقع في جهاتها الشرقية والغربية وفي الجزء الجنوبي الشرقي فكان لهذه الطبيعة دورا في حماية المدينة من الأعداء\r\n\r\nمناخ المدينة :\r\nحار جاف صيفا بارد قليل الأمطار شتاء هذا المناخ جعل سكان المدينة يعتمدون على الأودية في الزراعة وذلك بعد أن تهطل الأمطار في فصل الشتاء والربيع وحين يأتي فصل الصيف الذي تشتد فيه الحرارة والجفاف تقل مياه الأودية فيتجه السكان إلى الآبار لسقي مزروعاتهم\r\n\r\n	2016-03-17 23:30:11.719496	2016-03-17 23:30:11.719496
