500	\N	264	Sun, Mon, Tue, Wed, Thu	Sun\r\n11.1 Probability\r\nThe probability of an event, P(event), is the measure of how likely the event is to occur. The probability is a measure between 0 and 1.\r\nP(event) + P(complement) =  1\r\n\r\nMon\r\n11.2 Experimental Probability\r\nExample: There are 5 marbles in a bag: 4 are blue, and 1 is red. What is the probability that a blue marble will be picked?\r\nNumber of ways it can happen: 4 (there are 4 blues)\r\nTotal number of outcomes: 5 (there are 5 marbles in total)\r\nSo the probability is 4/5=0.8\r\n\r\nTue\r\n11.4 Theoretical Probability\r\nExample: A bag contains 10 red marbles, 8 blue marbles and 2 yellow marbles. Find the theoretical probability of getting a blue marble.\r\nSolution: \r\nThere are 8 blue marbles. Therefore, the number of favorable outcomes = 8.\r\nThere are a total of 20 marbles. Therefore, the number of total outcomes = 20\r\n \r\nWed & Thu\r\n11.6 Independent and dependent events\r\n\r\nIndependent Events\r\nWhen two events are said to be independent of each other, what this means is that the probability that one event occurs in no way affects the probability of the other event occurring. An example of two independent events is as follows; say you rolled a die and flipped a coin. The probability of getting any number face on the die in no way influences the probability of getting a head or a tail on the coin.\r\nProbability of two independent events\r\nP(A and B) = P(A) * P(B)\r\n\r\nDependent Events\r\n\r\nWhen two events are said to be dependent, the probability of one event occurring influences the likelihood of the other event.\r\nProbability of two dependent events\r\nP(A and B)= P(A) * P(B after A)\r\n\r\n	2016-03-30 09:49:30.567654	2016-03-30 09:49:30.567654
