498	\N	263	Sun, Mon, Tue, Wed, Thu	Sun - Ls 13.1 Terms of Arithmetic Sequences\r\nA sequence is an ordered list of numbers or objects. Each number or object in a sequence is called a term.\r\nIn an arithmetic sequence, the difference between one term and the next is always the same. This difference is called the common difference. The common difference is added to each term to get the next term.\r\n\r\nMon - 13.1 Continued\r\n\r\nTuesday\r\nLs 13.2 Terms of Geometric Sequences\r\nIn a geometric sequence, the ratio of consecutive terms is always the same. The ratio of a term to the previous term is called the common ratio. \r\nThe common ratio is multiplied by each term to get the next term.\r\n\r\nWednesday - Math Quiz 1 on Chapter 12\r\n\r\nThursday - Ls 13.2 Terms of Geometric Sequences Continued\r\n	2016-03-30 09:39:14.268183	2016-03-30 09:39:14.268183
